subSubSection.paragraph:
Description of hypopygium and genitalia.
(

Figs 138
, 
145–147
). Hypopygium (
Fig. 138
) puncticulate; posterior margin strongly angulate; teeth of posterior margin straight, teeth closed each other, almost evenly thick; lateral stalk present and long. Genitalia (
Figs 145–147
) with paramere doble. Paramere not fused to basiparamere; inner margin of ventral arm not angulate; basiparamere with apical margin not angulate; volsella not surpassing aedeagus apex; cuspis short, 0.10 length of apical lobe of aedeagus, 1.0 width of apical lobe of aedeagus; digitus 0.40 length of apical lobe of aedeagus, upper surface spinose; aedeagus with median region as wide as base; apical lobe long, 0.50 length of apical lobe of aedeagus, fold of inner margin present; apex almost straight.
